private static Map<INode, INode> cloneDiffList(List<INode> diffList) {
  if (diffList == null || diffList.size() == 0) {
    return null;
  }
  Map<INode, INode> map = new HashMap<INode, INode>(diffList.size());
  for (INode node : diffList) {
    map.put(node, node);
  }
  return map;
}
